e 0,1 mL/kgBB bolus (iv), masih tidak ada respon. Jam 13.45 WIB memberikan epinephrine ( kedua) 0,1 ml/kgBB (iv) dan lanjutkan VTP + kompresi dada dan masih belum respon. Jam 13.48 WIB : HR 50x/menit, SpO2 48x/menit lanjut VTP + Kompresi dada. jam 13.50 WIB : HR dan SpO2 tidak terbaca (tidak terdeteksi) lanjut pemberian VTP + Kompresi dada dan pepinephrine (ketiga) 0,1 ml/kgBB (iv) dengan VTP + Kompresi dada dilanjutkan sampai jam 13.55 WIb tapi masih tidak ada respon, HR, SpO2 dan RR masih tidak terdeteksi. Jam 14.00 WIB pupil tampak midriasis maximal, respon tidak ada dan pasien dinyatakan meninggal dunia oleh dokter jaga dihadapan Duty dan perawat jaga Pagi. Jam 14.02 WIB, Duty dan perawat jaga menghubungi pihak penanggungjawab (Pihak dari Kejaksaan) tapi tidak diangkat-angkat, kemudian menghubungi IPJ untuk pemulasaran Jenazah.', 'Gangguan ventilasi spontan, dan menyusui tidak efektif tidak teratasi
', 'Perawatan Jenazah', '', '', '', '', '', '', '', '', '1684', '1', '<b>Perawatan jenazah</b>', NULL, '1684', 0, NULL, '2025-04-07 17:26:40')
