ERROR - 2025-04-07 18:59:52 --> Query error: ERROR:  invalid byte sequence for encoding "UTF8": 0xcc 0x2c - Invalid query: INSERT INTO "sm_cppt" ("id_layanan_pendaftaran", "waktu", "id_profesi", "subject", "objective", "assessment", "plan", "ademi_assesment", "ademi_diag", "ademi_interv", "ademi_monev", "sbar_situation", "sbar_background", "sbar_assesment", "sbar_recommend", "id_nadis", "ttd_nadis", "instruksi_ppa", "id_dokter_dpjp", "id_user", "konsul_via_telp", "konsul", "created_date") VALUES ('720238', '2025-04-07 18:50', '18', 'tidak dapat dikaji', 'A: terdapat sumbatan (epignati teratoma), terintubasi dengan ETT no. 3,5 cm Batas bibir 8,5 cm (07/04/25), hipersaliva, slym ETT warna kuning kental; B: terpasang mode ventilator Pressure A/C Rate 45 Pip 21/5 I:E 1:2 FiO2 30%, SpO2: 99%, nafas cuping hidung tidak ada, retraksi dada minimal, RR: 46x/menit,. spontane rate banyak; C: CRT kurang dari 3 detik, nadi teraba cukup kuat, terpasang PICC di tangan kanan dengan nutriline batas 16,5 cm (06/04/2025) untuk cairan D7,5 (240) + NaCl 3 persen (10) + KCL (2,5) + Ca gluconas (2,5) = 10 cc/jam, AA 6% = 1,7 cc/jam, Morfin 1 mg in Nacl 0.9cc = 0,6 cc/jam, midazolam 5 mg in NaCl 0,9\c = 0,02 cc/jam, terpasang infus perifer di tangan kanan (07/04/25) untuk obat, post loading NaCl 0,9Ì, HR: 165x/menit; D: buka mata spontan ada, gerak aktif, pupil isokor 2/2; E: klinis tampak mulai ikterik, suhu: 37,1*C, minum asip 5-8 cc/3 jam (5 cc), muntah tidak ada, abdomen supel, BAB tidak ada, total BAK 94 cc/7jam, diuresis 5,2 cc/kgbb. BBL: 2500 gr, LK: 32 cm, LP: 28 cm, LD: 30 cm, PB: 47 cm. Hasil Lab (7/4/25): Hb 10.4 (L) / Ht 28 (L) / Leukosit 10.2 / trombosit 413 / Ureum 17 / Kreatinin 0.4 (L)', 'Gangguan ventilasi spontan, Menyusui tidak efektif', 'Setelah dilakukan tindakan keperawatan selama 7x24 jam diharapakan ventilasi spontan meningkat dengan kriteria hasil: penggunaan otot bantu nafas menurun, gelisah menurun, dispneu menurun, takikardi membaik, PO2 membaik dan Status menyusui membaik dengan kriteria hasil : Perlekatan bayi pada payudara ibu meningkat, Kemampuan ibu memposisikan bayi meningkat, Hisapan bayi meningkat, Bayi rewel menurun, Berat Badan Bayi Meningkat', '', '', '', '', '', '', '', '', '1682', '1', '<p><b>Intervensi Keperawatan: </b>Monitor adanya kelelahan otot bantu nafas, Monitor status respirasi dan oksigenisasi, Pertahankan kepatenan jalan nafas, Bantu untuk merubah posisi jika diperlukan, Lakukan auskultasi bunyi pernafasan secara teratur, Identifikasi keadaan emosional ibu saat akan dilakukan konseling menyusui, Identifikasi keinginan dan tujuan menyusui, Identifikasi permasalahan yang ibu alami selama proses menyusui, Berikan informasi dan saran menyusui yang benar sesuai kebutuhan ibu.</p><p><div><b>Kolaborasi:</b> Follow up expertise reintubasi (7/4/25), R/ SHK sebelum rujuk, R/ Rujuk bedah anak -> rujukan full, rencana kultur sputum besok pagi, cek DR, ureum kreatinin -> hasil (+) lapor (+),</div></p>', NULL, '1682', 0, NULL, '2025-04-07 18:59:52')
